import React from "react";
import {Home} from "./components/Home";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <>
      <Navbar />
      <Route>
        <Home />
      </Route>
      <Route>
        <About />
      </Route>
      <Route>
        <Contact />
      </Route>
    </>
  );
};

export default App;
